import React,{Component} from 'react'

export default class Lucks extends Component{
    constructor(props){
        super(props);
        this.state={
          
            licksList:[]
        }
    }
    getLucksData(){
        axios.get("http://154.8.228.237:3000/luck").then((res)=>{
            // console.log(res)
              dispatch({
                  type:"DATA",
                  data:res.data.kejilist
              })
     });
    }
    render(){
        return <div>
            lucks 页面

        </div>
    }
}
